pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective message contents
    mapping (uint256 => string) public messages;

    // Mapping of message IDs to their update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to their authors (deployer addresses)
    mapping (uint256 => address) public authors;

    // Counter for generating unique message IDs
    uint256 public messageIdCounter = 0;

    // Function to save a new message on the blockchain
    function saveMessage(string memory _message) public {
        // Generate a new unique message ID
        messageIdCounter++;

        // Store the message content, update count, and author
        messages[messageIdCounter] = _message;
        updateCounts[messageIdCounter] = 0;
        authors[messageIdCounter] = msg.sender;
    }

    // Function to update a message privately
    function updateMessage(uint256 _id, string memory _newMessage) public {
        // Check if the message exists and the caller is the author
        require(_id > 0 && messages[_id] != "", "Message does not exist.");
        require(authors[_id] == msg.sender, "Only the author can update the message.");

        // Update the message content and increment the update count
        messages[_id] = _newMessage;
        updateCounts[_id]++;
    }

    // Function to get the message content by ID
    function getMessage(uint256 _id) public view returns (string memory) {
        // Check if the message exists
        require(_id > 0 && messages[_id] != "", "Message does not exist.");

        // Return the message content
        return messages[_id];
    }

    // Function to get the update count by ID
    function getUpdateCount(uint256 _id) public view returns (uint256) {
        // Check if the message exists
